AS3_Val byte(void* self, AS3_Val args )
{
	int value = AS3_IntValue( args );
	AS3_Release(args);

	return AS3_Int((char)value);
}


AS3_Val floatToRawIntBits(void* self, AS3_Val args)
{
	float value = AS3_NumberValue( args );
	AS3_Release(args);
	
	union {
		int i;
	   float f;
	} u;

	u.f = (float)value;

	return AS3_Int( u.i );
}

AS3_Val intBitsToFloat(void* self, AS3_Val args)
{
	int value = AS3_IntValue(args);
	AS3_Release(args);
    union {
        int i;
        float f;
    } u;
    u.i = (long)value;
    return AS3_Number(u.f);
}

AS3_Val longBitsToDouble(void* self, AS3_Val args)
{
    union {
        long l;
        double d;
    } u;
    
	long value = AS3_NumberValue(args);
	AS3_Release(args);
    u.l = value;
    return AS3_Number(u.d);
}

